protected int compareAttribrutes(Schedulable s1, Schedulable s2) {
  int res = (int) Math.signum(s1.getStartTime() - s2.getStartTime());

  if (res == 0) {
    res = s1.getName().compareTo(s2.getName());
  }

  return res;
}
